"use strict";

var _ =                 	require("underscore");
var SKELETON =          	require("./SpellingSkeleton");
var TrickLetterHelper =		require("./TrickLetterHelper");

var BG_COLORS = [
	["#1DB2A1", "#00ab7c"],   //green
	["#308DB8", "#2661a9"],   //blue
	["#d70212", "#851B23"],   //red
	["#602581", "#602581"]    //purple
];

var BG_IMGS = [ // green, blue, pink, yellow
	"data:image/png;base64,",
	"data:image/png;base64,",
	"data:image/png;base64,",
	"data:image/png;base64,"
];

var _getTimeAllowed = function(numWords){
	var idealLength = (numWords * 90); // because they can choose to read it for 1 minute, plus 30 seconds grace
	var ALLOWED_TIMES = [600,900,1200,1800];
	if(idealLength <= 600){
		return 600;
	}
	if(idealLength <= 900){
		return 900;
	}
	if(idealLength <= 1200){
		return 1200;
	}
	if(idealLength <= 1800){
		return 1800;
	}
	return 900;
};

var DEFAULT_ROW = {
	"year":"1",
	"term":"term",
	"week":"week",
	"day":"day",
	"wordlist":"",
	"focus":"focus",
	"child focus":"child focus",
	"info":"info",
	"default time":10,
	"input mode":"drag"
};

var ALLOWED_CHARS = "[A-Za-z']";
var REG_EXP =  new RegExp("^(" + ALLOWED_CHARS + "+)$");
var REG_EXP_NEG =  new RegExp("[^" + ALLOWED_CHARS + "]+", "g");

var _toLower = function(obj){
	var obj2 = {};
	_.each(obj, function(val, key){
		obj2[key.toLowerCase().trim()] = val;
	});
	return obj2;
};

var _getVoiceOverForWord = function(word, options){
	word = word.replace(/'/g, '_');
	word = word.toLowerCase();
	return "spelling_" + options.year + ":" + word;
};

var _getWords = function(str){
	var arr, SEPARATOR = ",";
	if(!str){
		return null;
	}
	str = str.replace(/\s/g,',').trim(); // remove all whitespace of all kinds
	str = str.replace(REG_EXP_NEG,SEPARATOR); // replace anything we dont like with commas
	arr = str.split(",");
	arr = _.map(_.uniq(arr), function(word){
		return word.replace(/\s/g,'').trim();
	});
	arr = _.filter(arr, function(word){
		return (word && word.length >= 2 && REG_EXP.test(word));
	});
	return arr;
};

var _getFileName = function(row){
	return "y" + row.year.trim() + "_" + row.term.trim() + "_" + row.week.trim() + "_" + row.day.trim() + ".2quiz";
};

var SpellingQuestionMaker = function(){
	
};

SpellingQuestionMaker.makeQues = function(word, id, options){
	var trickletters = TrickLetterHelper.get(word, false);
	var letterorder = _.shuffle((word + trickletters).split("")).join("");
	var answerStyle = options.answerStyle.toLowerCase();
	if(["drag", "tile", "tiles", "drags"].indexOf(answerStyle) >= 0){
		answerStyle = "drag";
	}
	else{
		answerStyle = "type";
	}
	return {
		"config": {
			"type": "spelling",
			"data": {
				"question": word,
				"trickletters": trickletters,
				"letterorder": letterorder,
				"qAnimation": "anim",
				"timeAnimation": parseInt(options.timeAnimation),
				"answerStyle": answerStyle,
				"tileStyle": options.tileStyle || "plastic",
				"upperCase": false,
				"extras": {
					"voiceover": _getVoiceOverForWord(word, options)
				}
			}
		},
		"questionId": "" + id // a string
	}
};

SpellingQuestionMaker.make = function(row){
	var json, wordlist, bgs, randomIndex;
	randomIndex = Math.floor(Math.random()*BG_IMGS.length);
	json = JSON.parse(JSON.stringify(SKELETON)); //clone default json
	row = _toLower(row);
	row = _.extend({}, DEFAULT_ROW, row);
	json.settings.introScreen.imageCache.main = BG_IMGS[randomIndex];
	json.settings.introScreen.text.contents = "Today's spelling practice is: '" + row["child focus"] + "'. Good luck!";
	json.settings.introScreen.title.contents = "Spelling quiz";
	bgs = BG_COLORS[randomIndex];
	json.settings.introScreen.backgroundBox.backgroundColor = bgs[0];
	json.settings.introScreen.title.backgroundColor = bgs[1];
	wordlist = _getWords(row.wordlist);
	if(wordlist && wordlist.length >= 1){
		// ok we have some words
		json.settings.introScreen.timer.data.startTimeInSeconds = _getTimeAllowed(wordlist.length);
		_.each(wordlist, function(word){
			var id = json.questions.length + 1;
			var options = {
				timeAnimation:row["default time"],
				answerStyle:row["input mode"],
				tileStyle:"plastic",
				year:row.year
			};
			json.questions.push(SpellingQuestionMaker.makeQues(word, id, options));
			json.order.edges.push(["" + id, "" + (id + 1)]); // strings!
		});
		json.order.edges.pop();
		var newName = _getFileName(row);
		return {
			"name":newName,
			"json":json
		};
	}
};

module.exports = SpellingQuestionMaker;
